# OEIS sequence: A094711

from sympy import isprime, prime, primerange
def aupton(terms):
  phash, alst = 2, []
  for p in primerange(3, prime(terms)+1):
    phash *= p
    for k in range(1, phash//2):
      if isprime(phash-k) and isprime(phash+k): alst.append(phash+k); break
  return alst
